import { useEffect, useState } from "react";
import { Table } from "react-bootstrap";
import axios from "axios";
import { Stack, Pagination } from "@mui/material";

export default function Paginationdata() {
  const [userData, setUserData] = useState([]);

  useEffect(() => {
    getdata();
  }, []);

  function getdata() {
    // fack api s fro data

    // const url = "https://api.instantwebtools.net/v1/airlines";
    // const url = "http://45.90.108.154/users";
    const url = "https://jsonplaceholder.typicode.com/posts";
    axios.get(url).then((res) => {
      console.log(res.data);
      setUserData(res.data);
    });
  }

  const [page, setPage] = useState(1);

  return (
    <>
      <h1> {page} </h1>

      <div className=" container  table-responsive-lg mt-5 pt-1 pb-5 table  table-responsive-sm  table-responsive-md">
        <Table bordered striped hover>
          <thead>
            <tr>
              <th>id</th>
              <th> Name</th>
              <th> phone</th>
            </tr>
          </thead>
          <tbody>
            {userData.slice(0, 20).map((curElm, id) => {
              return (
                <tr key={curElm.id}>
                  <td> {curElm.id} </td>
                  <td> {curElm.body} </td>
                  <td> {curElm.title} </td>
                </tr>
              );
            })}
          </tbody>
        </Table>
        <div style={{ float: "right" }}>
          <Stack spacing={2}>
            <Pagination
              count={10}
              showFirstButton={true}
              color={"primary"}
              onChange={(event, value) => {
                setPage(value);
              }}
            />
          </Stack>
        </div>
      </div>
    </>
  );
}
